import React, { Fragment } from "react";
import Landing from "../component/Landing";
import Newfilms from "../component/Newfilms/Newfilms";

const Home = (props) => {
  const filmitem=props.one.map((movie)=>{
return(
  <Newfilms name={movie.name} url={movie.image} rate={movie.rate} />
)
  })
  return <Fragment>
        <Landing  />
     <div >{filmitem}</div>
  </Fragment>;
};
export default Home;
